import React from "react";
import Card from "./Card";
import emoji from "./emoji";

function createCard(emoji){
    return(
        <Card 
            key = {emoji.id}
            title = {emoji.title}
            name = {emoji.name}
            mean = {emoji.mean}
        />
    )
}

function App(){
    return (
        <div>
            <h1 className="heading">emojipedia</h1>
            {emoji.map(createCard)};
        </div>
    )
}

export default App
